import React from 'react';
import SalonItem from './SalonItem'; // Предполагается, что компонент CategoryItem находится в отдельном файле
import './stylecomponents.css';

const SalonList = ({ salons }) => {
  return (
    <div className="category-list">
      {salons.map(salon => (
        <SalonItem key={salon.salon_id} salon={salon} />
      ))}
    </div>
  );
};

export default SalonList;
